import React, { useContext } from "react";
import MyContext from "../context/MyContext";

const Section = () => {
  const context = useContext(MyContext);
  const { joke } = context;
  return (
    <div>
      <h1>{joke.value}</h1>
    </div>
  );
};

export default Section;
